import "./Footer.css";

const Footer = () => {
  return (
    <>
      <div className="footer">
        <div>
          <h5>About Us</h5>
          <ul>
            <li>About MarketEase</li>
            <li>Terms & Conditions</li>
            <li>Privacy Policy</li>

            <li>FAQs</li>
          </ul>
        </div>
      </div>
    </>
  );
}

export default Footer;
